import React from 'react';

import './TodoList.css';
import Todo from '../Todo/Todo';

const TodoList = () => {
    return (
        <div className='todolist'>
            Things todo
            <Todo />
            <Todo />
            <Todo />
        </div>
    );

}

export default TodoList;
